import React from "react";

export default function Sobre(props){
    return (
        <div className="page">
            <h2>O que é esse Blog?</h2>
            <p>Esse blog é um projeto e nesse projeto aprendemos a criar um SPA (single page app),<br/>
            e um sistema de login, utilizando redirecionamento de rotas,<br/> salvando informações de login
            no localStorage.</p>
        </div>
    )
}
